function lineStringLength(n,t,r,e){for(var i=n[t],g=n[t+1],a=0,h=t+e;h<r;h+=e){var l=n[h],L=n[h+1];a+=Math.sqrt((l-i)*(l-i)+(L-g)*(L-g)),i=l,g=L}return a}function linearRingLength(n,t,r,e){var i=lineStringLength(n,t,r,e),g=n[r-e]-n[t],r=n[r-e+1]-n[t+1];return i+=Math.sqrt(g*g+r*r)}export{lineStringLength,linearRingLength};